import styles from "./Global.module.css"
import data from "../../utils/constants/indonesia"
import CardCovid from "../CardCovid";

function Global() {
    const global = data.indonesia;
    return (
        <div className={styles.container}>
            <section className={styles.global}>
                <h2 className={styles.global__title}>Indonesia</h2>
                <h3 className={styles.global__}>Data Covid Berdasarkan Indonesia</h3>
                <div>
                    {global.map(function (cardcovid, key) {
                        return <CardCovid cardcovid={cardcovid} key={key} />;
                    })}
                </div>
            </section>
        </div>
    )
}

export default Global;
